import { useEffect, useState } from 'react'

import PortfolioList from '../portfolioList/PortfolioList';
import './portfolio.scss'

export default function portfolio() {

    const [selected, setSelected] = useState('featured')

    const list = [
        {
            id: 'tSEO',
            title: 'Technical-SEO',
        },
        {
            id: 'oSEO',
            title: 'On-page SEO',
        },
        {
            id: 'web',
            title: 'Web App',
        },
        {
            id: 'mobile',
            title: 'Mobile App',
        },
        {
            id: 'branding',
            title: 'Branding',
        },
        {
            id: 'content',
            title: 'Content',
        },

    ];
    return (
        <div className='portfolio' id='portfolio'>
            <h1>Portfolio</h1>
            <ul>
                {list.map(item => (<PortfolioList title={item.title} />))}
            </ul>
            <div className="container">
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
                <div className="item">
                    <img src="https://statuslabs.com/wp-content/uploads/SEO-Pillar-Post-Art-.png" alt="" />

                    <h3>Banking App</h3>
                </div>
            </div>
        </div>
    )
}
